import React, { Component } from 'react';
import styled from 'styled-components';
import image from './images/img.jpg'
import image1 from './images/img.jpg'
import image2 from './images/img.jpg'
const Section = styled.section`
margin-top: 50px;
`
const Container = styled.div``
const Row = styled.div``
const TitleContainer = styled.div``
const Title = styled.h1`
position: relative;
left: 10%;
`
const PostContainer = styled.div`
margin-top: 150px;
position: relative;
`
const Post = styled.div``
const Blog1 = styled.div`
`
const Image = styled.img`
position:absolute;
  top: 36%;
  left: 20%;
  transform: translate(-50%, -50%);
  width: 350px;
  height: 250px;
`
const Image1 = styled.img`
position:absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  width: 350px;
  height: 250px;
`
const Image2 = styled.img`
position:absolute;
  top: 50%;
  left: 80%;
  transform: translate(-50%, -50%);
  width: 350px;
  height: 250px;
`
const SinglePost = styled.div`

`
const PostTitle = styled.h5`
  `
const PostDesc = styled.h4``
const PostView = styled.p``


class Blog extends Component {
  render() {
    return (
      <LoginWrapper>
      <LoginAroundCanvas>
        <LoginDiv>

          <LoginHeader>
            <LoginHeaderSignUp active={true}>Sign up</LoginHeaderSignUp>
            <LoginHeaderLogIn>Log in</LoginHeaderLogIn>
          </LoginHeader>
          <EmailContainer>
            <EmailTitle>Email</EmailTitle>
            <EmailInput
              type='text'
              placeholder='john.doe@example.com'
              onChange={(e) => setTextInField(e.target.value)}
            ></EmailInput>{' '}
            <EmailBottomText>
              {!textInField && `You need to add an email.`}
            </EmailBottomText>
          </EmailContainer>
          <FLnameContainer>
          <FirstnameContainer>
            <FirstnameTitle>First Name</FirstnameTitle>
            <FirstnameInput
              type='text'
              placeholder='First Name'
              onChange={(e) => setTextInField(e.target.value)}
            >
            </FirstnameInput>{' '}
            <FirstnameBottomText>
              {!textInField && `You need to add First Name.`}
            </FirstnameBottomText>
          </FirstnameContainer>

          <LastnameContainer>
            <LastnameTitle>Last Name</LastnameTitle>
            <LastnameInput
              type='text'
              placeholder='Last Name'
              onChange={(e) => setTextInField(e.target.value)}
            >
            </LastnameInput>{' '}
            <LastnameBottomText>
              {!textInField && `You need to add Last Name.`}
            </LastnameBottomText>
          </LastnameContainer>
          </FLnameContainer>

          <PasswordContainer>
            <PasswordTitle>Password</PasswordTitle>
            <PasswordInput
              type='password'
              placeholder='****'
              onChange={(e) => setTextInField(e.target.value)}
            >
            </PasswordInput>{' '}
            <PasswordBottomText>
              {!textInField && `You need to add Password.`}
            </PasswordBottomText>
          </PasswordContainer>
          <RadioContainer>
            <Radiolabel>
              <RadioInput name="name" type="radio" />
              <RadioMark />
              I accept the terms and privacy policy
            </Radiolabel>
          </RadioContainer>
        </LoginDiv>
      </LoginAroundCanvas>
    </LoginWrapper>
    )
  }
}

export default Blog;
